import axios from "axios";

const SIGNUP = "SIGNUP";

export function signup(data) {
  axios
    .post("http://localhost:3065/user/signup", data)
    .then((res) => alert(res.data));
  return {
    type: SIGNUP,
  };
}

const initialState = {
  isLoggedIn: false,
  myInfo: null,
  signupError: null,
  signupSuccess: false,
};

export default function reducer(state = initialState, action) {
  switch (action.type) {
    case SIGNUP:
      return {
        ...state,
      };
    default:
      return state;
  }
}
